import React from "react";
import Loginpage from "./Loginpage";
import { useState } from "react";
const Modal = () => {
  const [openModal, setOpen] = useState(false);

  return (
    <div className="modalBackground">
      <div className="modalContainer">
        <Loginpage />
      </div>
    </div>
  );
};

export default Modal;
